import React from 'react';
import {LineChart, Line, ResponsiveContainer, YAxis, Tooltip, Legend} from 'recharts';

const ProgressChart = () => {

    const training = [
        {
            date: '20.12.2024',
            oneRM: 250,
            volume: 1240
        },
        {
            date: '22.12.2024',
            oneRM: 260,
            volume: 1140
        },{
            date: '24.12.2024',
            oneRM: 210,
            volume: 1540
        },{
            date: '25.12.2024',
            oneRM: 280,
            volume: 940
        },{
            date: '26.12.2024',
            oneRM: 290,
            volume: 900
        },{
            date: '27.12.2024',
            oneRM: 295,
            volume: 850
        },{
            date: '28.12.2024',
            oneRM: 200,
            volume: 2240
        },{
            date: '29.12.2024',
            oneRM: 180,
            volume: 2500
        },{
            date: '30.12.2024',
            oneRM: 180,
            volume: 2640
        }
    ];




  return (
    <ResponsiveContainer width='100%' height='100%'>
        <LineChart width={500} height={300} data={training} margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
        }}>
            <XAxis dataKey='date' />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line dataKey='oneRM' stroke='#8884d8'/>
            <Line dataKey='volume' />
        </LineChart>
    </ResponsiveContainer>
  )
}

export default ProgressChart
